import React from 'react';
import './Favouritesitem.css';

function Favouritesitem({ type, brand, location, date }) {
  return (
    <div className='item-content2'>
      <img src="https://images.unsplash.com/photo-1580910051074-3eb694886505?q=80&w=1000&auto=format&fit=crop&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxzZWFyY2h8MTR8fHBob25lfGVufDB8fDB8fHww" alt="Example image" width="200" height="150"/>
      <span>type: {type}</span>
      <span>brand: {brand}</span>
      <span>location: {location}</span>
      <span>added: {date}</span>
      <button>remove from favourites</button>
    </div>
  );
}

export default Favouritesitem;
